import Product from '../Product';

const brushes = ["Fan Brush", "Round Paint Brush", "Angular Brush"];

let text = "";

for(let i = 0; i < brushes.length; i++) {
    text += brushes[i];
}

const BrushesPage = () => {
    return (
        <div>
            <h2>Brushes</h2>
            <div className="flex-container">
                <Product />
                <Product />
                <Product />
                <Product />
            </div>
        </div>
    );

}

export default BrushesPage;
